===Japanese surface raiders===
{{sectstub}}
On 1 March 1944 a Japanese squadron consisting of the heavy cruisers [[Japanese cruiser Aoba|''Aoba'']] ([[flagship|flag]]), [[Japanese cruiser Tone|''Tone'']] and [[Japanese cruiser Chikuma|''Chikuma'']] sortied from the [[Sunda Strait]] to attack Allied shipping sailing on the main route between [[Aden]] and [[Fremantle]]. The only allied ship this squadron encountered was the British steamer ''Behar'' which was sunk about midway between [[Ceylon]] and [[Fremantle, Western Australia]] on 9 March 1944. Following this attack the Squadron broke off its mission and returned to [[Batavia]] as it was feared that Allied ships responding to the ''Behar's'' distress signal posed an unacceptable risk to the Japanese ships. While 102 ''Behar'' survivors were rescued by the [[Japanese cruiser Tone|''Tone'']], 82 of these survivors were murdered on board the ''Tone'' following her arrival in [[Batavia]] on 16 March. Following the war the squadron commander and the captain of the [[Japanese cruiser Tone|''Tone'']] were each sentenced to seven years imprisonment for this [[war crime]]. 

The sortie mounted by the [[Japanese cruiser Aoba|''Aoba'']], [[Japanese cruiser Tone|''Tone'']] and [[Japanese cruiser Chikuma|''Chikuma'']] was the last raid mounted by Axis surface ships against the Allied lines of communication in the Indian Ocean, and elsewhere, during World War II.

==Japanese naval aviation attacks on Australia==
===The initial air raid on Darwin===
{{seemain|Air raids on Darwin, February 19, 1942}}

The bombing of [[Darwin, Northern Territory|Darwin]] on February 19 1942 was the heaviest attack mounted by the [[Imperial Japanese Navy]] against mainland Australia. On February 19 1942 four Japanese aircraft carriers (the ([[Japanese aircraft carrier Akagi|''Akagi'']], [[Japanese aircraft carrier Kaga|''Kaga'']], [[Japanese aircraft carrier Hiryu|''Hiryu'']] and [[Japanese aircraft carrier Soryu|''Soryu'']]) launched a total of 188 aircraft from a position in the [[Timor Sea]]. Accompanied by 54 land-based bombers, these aircraft inflicted heavy damage on Darwin. The attackers sank 8 ships and destroyed 20 military aircraft and destroyed most military installations in the town. Allied casualties were over 243 killed and between 300 and 400 wounded. Only 4 Japanese aircraft were confirmed to have been destroyed by Darwin's defenders. 

===Subsequent overflights and attacks===
{{seemain|Japanese air attacks on Australia, 1942-43}}
While Australia was not subsequently attacked by Japanese aircraft carriers, the [[Imperial Japanese Navy|IJN]] operated aircraft over the Australian mainland on a number of occasions. Prior to the attack on Sydney harbour in May 1942 aircraft launched from the Japanese submarines overflew [[Hobart]], [[Melbourne]] and [[Sydney]] to investigate the Allied shipping in each port. In addition, [[Imperial Japanese Navy|IJN]] long-range [[seaplanes]] operating from bases in the [[Solomon Islands]] made a number of small  attacks on towns in [[northern Australia]], including the bombing of [[Townsville]] and [[Cairns]] in July 1942.
